import { memo } from "react";
import ApiTable from "../../components/TableView/ApiTable";

const pritnOptions = () => {
    return (
        <>
            <ApiTable
                api={"basicData/suppliers"}
                postApi={"basicData/suppliers_dml"}
                // columns={columns}
                hideTools={false}
                canEdit={true}
                canAdd={true}
                canDelete={true}
                rowKey={"supplier_id"}
            // Modal={ModalView}
            />
        </>
    )
}

export default memo(pritnOptions);
